import React, { useEffect, useRef } from "react";
import '../../component/grid.css';
import '../home/home.css';
import '../../component/style.css';
import '../home/responsive.css';
import banner1 from '../img/banner_img1.jpg';
import banner2 from '../img/banner_img2.jpg';
import banner3 from '../img/banner_img3.jpg';
import banner4 from '../img/banner_img4.jpg';
import banner5 from '../img/banner_img5.jpg';
import banner_home_1 from '../img/banner_home_1.jpg';
import banner_home_2 from '../img/banner_home_2.jpg';
import banner_home_3 from '../img/banner_home_3.jpg';
import banner_home_4 from '../img/banner_home_4.jpg';
import thangsachkimdong1 from '../img/thangsachkimdong1.jpg';
import thangsachkimdong2 from '../img/thangsachkimdong2.jpg';
import thangsachkimdong3 from '../img/thangsachkimdong3.jpg';
import thangsachkimdong4 from '../img/thangsachkimdong4.jpg';
import thangsachkimdong5 from '../img/thangsachkimdong5.jpg';
import sachmoi1 from '../img/sachmoi1.jpg';
import sachmoi2 from '../img/sachmoi2.jpg';
import sachmoi3 from '../img/sachmoi3.jpg';
import sachmoi4 from '../img/sachmoi4.jpg';
import sachmoi5 from '../img/sachmoi5.jpg';
import combo1 from '../img/combo1.jpg';
import combo2 from '../img/combo2.jpg';
import combo3 from '../img/combo3.jpg';
import combo4 from '../img/combo4.jpg';
import combo5 from '../img/combo5.jpg';
import manga_commic_1 from '../img/manga_comic_1.jpg';
import manga_commic_2 from '../img/manga_comic_2.jpg';
import manga_commic_3 from '../img/manga_comic_3.jpg';
import manga_commic_4 from '../img/manga_comic_4.jpg';
import manga_commic_5 from '../img/manga_comic_5.jpg';
import doraemon1 from '../img/doraemon1.jpg';
import doraemon2 from '../img/doraemon2.jpg';
import doraemon3 from '../img/doraemon3.jpg';
import doraemon4 from '../img/doraemon4.jpg';
import doraemon5 from '../img/doraemon5.jpg';
import wingsbooks1 from '../img/wings_book1.jpg';
import wingsbooks2 from '../img/wings_book2.jpg';
import wingsbooks3 from '../img/wings_book3.jpg';
import wingsbooks4 from '../img/wings_book4.jpg';
import wingsbooks5 from '../img/wings_book5.jpg';
import mua1tang1_1 from '../img/mua1tang1_1.jpg';
import mua1tang1_2 from '../img/mua1tang1_2.jpg';
import mua1tang1_3 from '../img/mua1tang1_3.jpg';
import mua1tang1_4 from '../img/mua1tang1_4.jpg';
import mua1tang1_5 from '../img/mua1tang1_5.jpg';


const Home = () => {
    const listImgRef = useRef(null);
    const imgsRef = useRef([]);
    const btnLeftRef = useRef(null);
    const btnRightRef = useRef(null);
    const dotsRef = useRef([]);

    useEffect(() => {
        function checkScreenSize() {
            const checkSizeMobile = document.querySelectorAll('.checkSizeMobile');
            checkSizeMobile.forEach(item => {
                if (window.innerWidth > 520) {
                    item.classList.remove('c-6');
                    item.classList.add('c-4');
                } else {
                    item.classList.remove('c-4');
                    item.classList.add('c-6');
                }
            });
        }

        const listImg = listImgRef.current;
        const imgs = imgsRef.current;
        const btnLeft = btnLeftRef.current;
        const btnRight = btnRightRef.current;
        const dots = dotsRef.current;

        let current = 0;

        const updateSlider = () => {
            let width = imgs[0]?.offsetWidth || 0;
            listImg.style.transform = `translateX(${-width * current}px)`;
            document.querySelector('.active')?.classList.remove('active');
            dots[current]?.classList.add('active');
        };

        const toRight = () => {
            current = (current === imgs.length - 1) ? 0 : current + 1;
            updateSlider();
        };

        const toLeft = () => {
            current = (current === 0) ? imgs.length - 1 : current - 1;
            updateSlider();
        };

        let autoChange = setInterval(toRight, 4000);

        const handleRightClick = () => {
            clearInterval(autoChange);
            toRight();
            autoChange = setInterval(toRight, 4000);
        };

        const handleLeftClick = () => {
            clearInterval(autoChange);
            toLeft();
            autoChange = setInterval(toRight, 4000);
        };

        btnRight?.addEventListener('click', handleRightClick);
        btnLeft?.addEventListener('click', handleLeftClick);

        dots.forEach((dot, index) => {
            dot.addEventListener('click', () => {
                current = index;
                updateSlider();
                clearInterval(autoChange);
                autoChange = setInterval(toRight, 4000);
            });
        });

        // Gọi function ngay khi component render
        checkScreenSize();

        // Lắng nghe sự kiện resize
        window.addEventListener('resize', checkScreenSize);

        return () => {
            window.removeEventListener('resize', checkScreenSize);

            clearInterval(autoChange);
            btnRight?.removeEventListener('click', handleRightClick);
            btnLeft?.removeEventListener('click', handleLeftClick);
            dots.forEach((dot) => dot.removeEventListener('click', () => { }));
        };
    }, []);

    return (
        <>
            <div className="banner">
                <div className="grid wide hide-on-mobile">
                    <div className="row" style={{ position: "relative" }}>
                        <div className="col m-12 l-12">
                            <div className="navbar">
                                <div className="danhmucsanpham">
                                    <div className="flex-center">
                                        <i
                                            className="fas fa-bars icon-white"
                                            style={{ marginRight: 2 }}
                                        />
                                        <b>DANH MỤC SẢN PHẨM</b>
                                    </div>
                                    <div className="list-box">
                                        <ul>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    LỊCH SỬ, TRUYỀN THỐNG
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    VĂN HỌC VIỆT NAM
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    VĂN HỌC NƯỚC NGOÀI
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    KIẾN THỨC, KHOA HỌC
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    TRUYỆN TRANH
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    MANGA - COMIC
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    WINGS BOOKS
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    GIẢI MÃ BẢN THÂN
                                                </li>
                                            </a>
                                            <a className="danhmuc-a" href="">
                                                <li className="list-box-item">
                                                    <i
                                                        className="fas fa-book"
                                                        style={{ fontSize: 16, marginRight: 4 }}
                                                    />
                                                    DÀNH CHO CHA MẸ
                                                </li>
                                            </a>
                                        </ul>
                                    </div>
                                </div>
                                <ul className="tintucgioithieu">
                                    <li className="tintuc" style={{ marginRight: 20 }}>
                                        <div className="tintucgioithieu-title">
                                            TIN TỨC
                                            <i className="fas fa-angle-down" />
                                        </div>
                                        <div className="list-box">
                                            <ul>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Hoạt động</li>
                                                </a>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Sự kiện</li>
                                                </a>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Điểm sách</li>
                                                </a>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Sách giả - Sách lậu</li>
                                                </a>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">
                                                        Lịch phát hành sách định kỳ
                                                    </li>
                                                </a>
                                            </ul>
                                        </div>
                                    </li>
                                    <li className="gioithieu">
                                        <div className="tintucgioithieu-title">
                                            GIỚI THIỆU
                                            <i className="fas fa-angle-down" />
                                        </div>
                                        <div className="list-box">
                                            <ul>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Giới thiệu nhà xuất bản</li>
                                                </a>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Tác giả - Tác phẩm</li>
                                                </a>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Công tác xã hội</li>
                                                </a>
                                                <a className="danhmuc-a" href="">
                                                    <li className="list-box-item">Khen thưởng của nhà nước</li>
                                                </a>
